import React from 'react';

const PostsDetail = (props) => {
    const data = props.data;
    //console.log(" vista de props",props)
    return (
        <div>
            <h3> {data.title} </h3>
            <p>{data.body} </p>
        </div>
        
    );
};

export default PostsDetail;
